eval("module.exports = \"<template>\\n    <div class=\\\"content-header\\\">\\n        <span class=\\\"content-title\\\">\\n            <i class=\\\"fas fa-chart-pie\\\" style=\\\"color: #2589BD\\\"></i>\\n            <span style=\\\"color: #F3EFF5\\\">\\n                Embedding Comparison\\n            </span>\\n        </span>\\n    </div>\\n    <div class=\\\"content-body\\\">\\n        <div class=\\\"row\\\">\\n            <div class=\\\"col m6\\\">\\n                <p>\\n                    The goal of embComp is to support users during the comparison of any high dimensional vector space\\n                    or\\n                    text embedding based on local metrics.\\n                    <a class=\\\"link\\\" href=\\\"https://arxiv.org/abs/1911.01542\\\"><i class=\\\"fas fa-long-arrow-right\\\"></i>\\n                        Publication\\n                        (under\\n                        review)</a>\\n                </p>\\n                <p>\\n                    <span class=\\\"text-highlight\\\">Abstract:</span> <br> This work introduces embComp, a novel approach\\n                    for comparing two\\n                    embeddings\\n                    that\\n                    capture the similarity between\\n                    objects, such as word and document embeddings. We survey scenarios where comparing these embedding\\n                    spaces is\\n                    useful. From those scenarios, we derive common tasks, introduce visual analysis methods that support\\n                    these\\n                    tasks, and combine them into a comprehensive system. One of embComp's central features are overview\\n                    visualizations that are based on metrics for measuring differences in local structure around\\n                    objects.\\n                    Summarizing these local metrics over the embeddings provides global overviews of similarities and\\n                    differences.\\n                    These global views enable a user to identify sets of interesting objects whose relationships in the\\n                    embeddings\\n                    can be compared. Detail views allow comparison of the local structure around selected objects and\\n                    relating\\n                    this\\n                    local information to the global views. Integrating and connecting all of these components, \\\\sysname\\n                    supports\\n                    a\\n                    range of analysis workflows that help understand similarities and differences between embedding\\n                    spaces. We\\n                    assess our approach by applying it in several use cases, including understanding corpora differences\\n                    via\\n                    word\\n                    vector embeddings, and understanding algorithmic differences in generating embeddings.\\n                </p>\\n\\n            </div>\\n            <div class=\\\"col m6\\\">\\n                <p>\\n                    <img src=\\\"https://www.dropbox.com/s/vg8eyxododo7kth/emb.png?dl=1\\\" alt=\\\"EmbComp Interface\\\"\\n                        style=\\\"width: 100%\\\">\\n\\n                </p>\\n            </div>\\n        </div>\\n    </div>\\n</template>\";//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///pages/emb.html\n");

