eval("module.exports = \"<template>\\n    <div class=\\\"content-header\\\">\\n        <span class=\\\"content-title\\\">\\n            <!-- <i class=\\\"fas fa-tags\\\" style=\\\"color: #2589BD\\\"></i> -->\\n            <span style=\\\"color: #F3EFF5\\\">\\n                Welcome!\\n            </span>\\n        </span>\\n    </div>\\n    <div class=\\\"content-body\\\">\\n        <p>\\n            I am a Research Assistant (Pre-Doc) at the University of Vienna. My main research interests are\\n            <span class=\\\"text-highlight\\\">Visualization</span> and <span class=\\\"text-highlight\\\">Human Computer\\n                Interaction/UX</span> with a\\n            strong\\n            focus on <span class=\\\"text-highlight\\\">Explainable AI</span>.\\n            This allows users to use complex machine learning methods (<a class=\\\"link\\\" href=\\\"#tagrefinery\\\"><i\\n                    class=\\\"fad fa-industry-alt\\\"></i> TagRefinery</a>) as well as\\n            understanding models and their results (\\n            <a class=\\\"link\\\" href=\\\"#black\\\"><i class=\\\"fad fa-analytics\\\"></i> Blackbox Viewer</a>,\\n            <a class=\\\"link\\\" href=\\\"#emb\\\"><i class=\\\"fad fa-chart-pie\\\"></i> EmbComp</a>\\n            ).\\n            Understanding textual data is a specific passion of mine.\\n            From text wrangling and preprocessing (\\n            <a class=\\\"link\\\" href=\\\"#tagrefinery\\\"><i class=\\\"fad fa-industry-alt\\\"></i> TagRefinery</a>),\\n            understanding of correlations and content of text collections\\n            (<a class=\\\"link\\\" href=\\\"#emb\\\"><i class=\\\"fad fa-chart-pie\\\"></i> EmbComp</a>) to information retrieval (\\n            <a class=\\\"link\\\" href=\\\"#lassi\\\"><i class=\\\"fad fa-tags\\\"></i>\\n                LAssi</a>).\\n        </p>\\n        <p>\\n            <span class=\\\"text-highlight\\\">Supervising </span> and <span class=\\\"text-highlight\\\">leading </span> people is\\n            a passion I first discovered during my time as a lead of software test\\n            team at Anton Paar GmbH.\\n            As a lecturer and supervisor I am able to support students during their problem definition, realization, and\\n            evaluation steps of their projects which is a deeply satisfying process.\\n        </p>\\n        <p>\\n            Feel free to contact me if you require <span class=\\\"text-highlight\\\"> consulting</span> in any of the\\n            aforementioned areas.\\n        </p>\\n    </div>\\n</template>\";//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///pages/intro.html\n");

