eval("module.exports = \"<template>\\n  <div class=\\\"content-header\\\">\\n    <span class=\\\"content-title\\\">\\n      <i class=\\\"fas fa-university\\\" style=\\\"color: #2589BD\\\"></i>\\n      <span style=\\\"color: #F3EFF5\\\">\\n        Teaching\\n      </span>\\n    </span>\\n  </div>\\n  <div class=\\\"content-body\\\">\\n    <!-- content -->\\n    <p>\\n      During winter semesters I teach <span class=\\\"text-highlight\\\">Visualization and Visual Data Analysis</span> (<a\\n        class=\\\"link\\\" target=\\\"_blank\\\" href=\\\"http://vda.univie.ac.at/Teaching/Vis/19w/schedule.html\\\"\\n        style=\\\"display: inline-block;\\\">Course page</a>)\\n      where\\n      I teach students how to\\n      design visualizations and dashboards using Tableau as well as D3.js.\\n      In the summer semesters I teach <span class=\\\"text-highlight\\\">Human Computer Interaction</span>(<a class=\\\"link\\\"\\n        target=\\\"_blank\\\" href=\\\"http://vda.univie.ac.at/Teaching/HCI/19s/schedule.html\\\"\\n        style=\\\"display: inline-block;\\\">Course page</a>)\\n      where\\n      I teach students about design principles\\n      and the design of smartphone apps using the user centered design process and design thinking.\\n    </p>\\n\\n    <p>\\n      Besides teaching at the university I also taught visualization principles on two <span class=\\\"text-highlight\\\">deep\\n        learning summer\\n        schools</span> (<a class=\\\"link\\\" target=\\\"_blank\\\"\\n        href=\\\"https://datascience.univie.ac.at/news-events/data-science-summer-school-uni-vienna-2018/\\\"\\n        style=\\\"display: inline-block;\\\">2018</a>, <a class=\\\"link\\\" target=\\\"_blank\\\"\\n        href=\\\"https://datascience.univie.ac.at/news-events/detail-news/news/apply-for-data-science-summer-school-2019/?tx_news_pi1%5Bcontroller%5D=News&tx_news_pi1%5Baction%5D=detail&cHash=540a4cf17156c02bfd8de9010b16453a\\\"\\n        style=\\\"display: inline-block;\\\">2019</a>)\\n      and\\n      a qualification seminar for <span class=\\\"text-highlight\\\">professionals from industry</span> (<a class=\\\"link\\\"\\n        target=\\\"_blank\\\" href=\\\"https://vda.cs.univie.ac.at/research/projects/project/306/\\\"\\n        style=\\\"display: inline-block;\\\">Project\\n        Page</a>).\\n    </p>\\n\\n    <p>\\n      I supervise students during bachelor thesis, master thesis and master projects. I am lucky to work with amazing\\n      students\\n      on interesting topics in different areas like:\\n    </p>\\n    <span class=\\\"text-highlight\\\">\\n      Machine learning\\n    </span>\\n    <ul>\\n      <li>\\n        - Using deep neural networks to extract components from publications.\\n      </li>\\n      <li>\\n        - Validating multi-class classifiers.\\n      </li>\\n      <li>\\n        - Comparing dimensionality reduction methods.\\n      </li>\\n    </ul>\\n\\n    <span class=\\\"text-highlight\\\">\\n      Natural Language Processing\\n    </span>\\n    <ul>\\n      <li>\\n        - PDF structure analysis based on natural language processing.\\n      </li>\\n      <li>\\n        - Comparison of text embedding pipelines.\\n      </li>\\n      <li>\\n        - Visual CLustering of documents based on non-optimal embeddings.\\n      </li>\\n    </ul>\\n\\n    <span class=\\\"text-highlight\\\">\\n      Human Computer Interaction\\n    </span>\\n    <ul>\\n      <li>\\n        - Understanding human biases during usage of correlation visualizations.\\n      </li>\\n      <li>\\n        - Redesigning the ticket ordering process for train tickets.\\n      </li>\\n      <li>\\n        - Using gamification to teach employees about information security.\\n      </li>\\n      <li>\\n        - How to integrate 2nd screen applications during e-sports events.\\n      </li>\\n    </ul>\\n  </div>\\n</template>\";//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///pages/teaching.html\n");

